INSERT INTO `case_document` VALUES (228, '起诉状.docx', 'word', '民事起诉状\n原告：张三甲，住所地深圳南山西丽，统一社会信用代码：。\n法定代表人：张三甲。\n被告：XX 市 XX 区 XX 建材经营部，住所地，统一社会信用代码：92XXXXXXXXX。\n法定代表人：。\n诉讼请求：\n事实与理由：\n此致\n人民法院\n具状人: 张三甲\n2025-05-05', 0, 50, NULL, 0, 'cases/50/case_documents/起诉状.docx', 15921, 'manual', '起诉状.docx', '2025-10-30 18:47:01.204294', 1, '1', NULL, NULL, '2025-10-30 18:47:01.204294', NULL, NULL, '/case_documents', NULL, 'local', NULL, 22, 1, 16, 4, 0);
INSERT INTO `case_document` VALUES (229, '财产保全申请书.docx', 'word', '财产保全申请书\n申请人：张三甲，住所地深圳南山西丽，统一社会信用代码：。\n法定代表人：张三甲。\n被申请人：XX 市 XX 区 XX 建材经营部，住所地，统一社会信用代码：92XXXXXXXXX。\n法定代表人：。\n请求事项：\n依法冻结被申请人资金请求判令被告支付合同款项人民币48,000.00元元或者查封、扣押相应的财产。\n事实和理由：\n申请人与被申请人广东立群建筑劳务有限公司vs中铁十九局集团第五工程有限公司（第三人：东莞市易发混凝土有限公司）一案，已诉至贵院。为了保护申请人的合法权益，防止被申请人逃避债务，根据《中华人民共和国民事诉讼法》第一百条之规定，特申请人民法院依法查封、扣押、冻结被申请人相应的财产。\n如申请有错误，申请人愿意承担相应的法律责任。\n此 致\n人民法院\n申请人：张三甲\n2025-05-05', 0, 50, NULL, 0, 'cases/50/case_documents/财产保全申请书.docx', 12865, 'manual', '财产保全申请书.docx', '2025-10-30 18:47:01.285966', 1, '1', NULL, NULL, '2025-10-30 18:47:01.285966', NULL, NULL, '/case_documents', NULL, 'local', NULL, 23, 1, 16, 3, 0);
INSERT INTO `case_document` VALUES (230, '撤诉申请书.docx', 'word', '撤诉申请书\n申请人：张三甲，住所地深圳南山西丽，统一社会信用代码：。\n法定代表人：张三甲。\n被申请人：XX 市 XX 区 XX 建材经营部，住所地，统一社会信用代码：92XXXXXXXXX。\n法定代表人：。\n申请人与被申请人{{case_name}}一案，业已经贵院立案受理，受理案号为{{case_number}}，现申请人依据《中华人民共和国民事诉讼法》之规定，依法申请                            ，请核准。\n此    致\n人民法院\n申请人：张三甲\n2025-05-05', 0, 50, NULL, 0, 'cases/50/case_documents/撤诉申请书.docx', 12344, 'manual', '撤诉申请书.docx', '2025-10-30 18:47:01.358962', 1, '1', NULL, NULL, '2025-10-30 18:47:01.358962', NULL, NULL, '/case_documents', NULL, 'local', NULL, 24, 1, 16, 3, 0);
INSERT INTO `case_document` VALUES (231, '撤销授权.docx', 'word', '撤销授权委托的声明\n：\n贵院受理的张三甲与XX 市 XX 区 XX 建材经营部{{case_name}}一案，现张三甲撤销委托代理人              的授权。\n特此声明！\n声明人：张三甲\n2025-05-05', 0, 50, NULL, 0, 'cases/50/case_documents/撤销授权.docx', 11676, 'manual', '撤销授权.docx', '2025-10-30 18:47:01.415593', 1, '1', NULL, NULL, '2025-10-30 18:47:01.415593', NULL, NULL, '/case_documents', NULL, 'local', NULL, 25, 1, 16, 3, 0);
INSERT INTO `case_document` VALUES (232, '法定代表人身份证明.docx', 'word', '法定代表人身份证明\n兹证明张三甲是张三甲的法定代表人。\n证明人：张三甲\n2025-05-05', 0, 50, NULL, 0, 'cases/50/case_documents/法定代表人身份证明.docx', 11276, 'manual', '法定代表人身份证明.docx', '2025-10-30 18:47:01.461223', 1, '1', NULL, NULL, '2025-10-30 18:47:01.461223', NULL, NULL, '/case_documents', NULL, 'local', NULL, 26, 1, 16, 5, 0);
INSERT INTO `case_document` VALUES (233, '解除财产保全申请书.docx', 'word', '解除财产保全申请书\n申请人：张三甲，住所地深圳南山西丽，统一社会信用代码：。\n法定代表人：张三甲。\n被申请人：XX 市 XX 区 XX 建材经营部，住所地，统一社会信用代码：92XXXXXXXXX。\n法定代表人：。\n请求事项：\n解除对被申请人财产的全部保全措施。\n事实和理由：\n申请人和被申请人{{case_name}}一案，案号为{{case_number}}，现因                         ，特申请解除本案的财产保全。望贵院批准。\n此致\n人民法院\n申请人：张三甲\n2025-05-05', 0, 50, NULL, 0, 'cases/50/case_documents/解除财产保全申请书.docx', 12527, 'manual', '解除财产保全申请书.docx', '2025-10-30 18:47:01.536231', 1, '1', NULL, NULL, '2025-10-30 18:47:01.536231', NULL, NULL, '/case_documents', NULL, 'local', NULL, 27, 1, 16, 3, 0);
INSERT INTO `case_document` VALUES (234, '授权委托书.docx', 'word', '授权委托书\n委托人张三甲，住所地深圳南山西丽，统一社会信用代码：。\n法定代表人：张三甲。\n受托人：\n联系电话：\n受托人：\n联系电话：\n关于张三甲与XX 市 XX 区 XX 建材经营部{{case_name}}一案，委托人张三甲现委托______________担任本案代理人。\n的代理权限为以下第（1）种：\n的代理权限为以下第（2）种：\n（1）特别授权代理，包括：代为起诉、代为送达、代为提起管辖异议，代为提起反诉，放弃、变更诉讼请求，和解、调解，提起上诉，申请执行，提交、签收、受领本案诉讼文书，代为收取案款，代为领取诉讼费等，以及一般代理的各项权限。\n（2）一般授权代理，包括：立案、申请财产保全、查阅、复制本案诉讼文书，提交诉状/答辩状、提交证据、出庭、参加法庭调查、举证质证、发表辩论意见，提交、签收、受领本案诉讼文书、申请调查取证及申请退费等。\n特此授权。\n委托人：张三甲\n2025-05-05', 0, 50, NULL, 0, 'cases/50/case_documents/授权委托书.docx', 12582, 'manual', '授权委托书.docx', '2025-10-30 18:47:01.606222', 1, '1', NULL, NULL, '2025-10-30 18:47:01.605224', NULL, NULL, '/case_documents', NULL, 'local', NULL, 28, 1, 16, 5, 0);
INSERT INTO `case_document` VALUES (235, '诉前保全申请书.docx', 'word', '诉前保全申请书\n申请人:张三甲，住所地深圳南山西丽，统一社会信用代码：。\n法定代表人：张三甲。\n被申请人：XX 市 XX 区 XX 建材经营部，住所地，统一社会信用代码：92XXXXXXXXX。\n法定代表人：。\n申请事项：\n请求依法冻结上述被申请人资金{{contract_amount}}元或查封、扣押相应的财产。\n事实和理由：\n如申请有错误，申请人愿意承担相应的法律责任。\n此  致\n人民法院\n申请人：张三甲\n2025-05-05', 0, 50, NULL, 0, 'cases/50/case_documents/诉前保全申请书.docx', 11014, 'manual', '诉前保全申请书.docx', '2025-10-30 18:47:01.668226', 1, '1', NULL, NULL, '2025-10-30 18:47:01.668226', NULL, NULL, '/case_documents', NULL, 'local', NULL, 29, 1, 16, 3, 0);
INSERT INTO `case_document` VALUES (236, '续封申请书.docx', 'word', '续封申请书\n申请人：张三甲，住所地深圳南山西丽，统一社会信用代码：。\n法定代表人：张三甲。\n被申请人：XX 市 XX 区 XX 建材经营部，住所地，统一社会信用代码：92XXXXXXXXX。\n法定代表人：。\n请求事项：\n请求贵院依法对被申请人XX 市 XX 区 XX 建材经营部续行查封、冻结、扣押。\n事实和理由：\n申请人与被申请人{{case_name}}一案，案号为{{case_number}}，贵院已依法受理。申请人已向贵院申请财产保全，现鉴于查封、冻结、扣押期限即将届满。依据《最高人民法院关于人民法院民事执行中查封、扣押、冻结财产的规定》第二十九条规定，现申请贵院对被申请人财产续行查封、冻结、扣押。\n此 致\n人民法院\n申请人：张三甲\n2025-05-05', 0, 50, NULL, 0, 'cases/50/case_documents/续封申请书.docx', 12701, 'manual', '续封申请书.docx', '2025-10-30 18:47:01.760385', 1, '1', NULL, NULL, '2025-10-30 18:47:01.760385', NULL, NULL, '/case_documents', NULL, 'local', NULL, 30, 1, 16, 3, 0);
INSERT INTO `case_document` VALUES (237, '追加被告申请书.docx', 'word', '追加被告申请书\n申请人：张三甲，住所地深圳南山西丽，统一社会信用代码：。\n法定代表人：张三甲。\n被申请人：XX 市 XX 区 XX 建材经营部，住所地，统一社会信用代码：92XXXXXXXXX。\n法定代表人：。\n申请事项：\n。\n事实与理由：\n申请人与XX 市 XX 区 XX 建材经营部{{case_name}}一案，因被申请人与本案正在进行的诉讼具有直接法律上的利害关系，为更好的查明本案事实和正确判定本案责任的承担，根据《中华人民共和国民事诉讼法》和最高人民法院关于适用《中华人民共和国民事诉讼法》若干问题的意见的规定，特申请追加被申请人                 为本案被告。\n此 致\n人民法院\n申请人:张三甲\n2025-05-05', 0, 50, NULL, 0, 'cases/50/case_documents/追加被告申请书.docx', 12215, 'manual', '追加被告申请书.docx', '2025-10-30 18:47:01.834240', 1, '1', NULL, NULL, '2025-10-30 18:47:01.834240', NULL, NULL, '/case_documents', NULL, 'local', NULL, 31, 1, 16, 2, 0);
