INSERT INTO `case_management` VALUES (6, '2024民初001', '民事纠纷', '张三诉李四买卖合同纠纷案', '原告张三与被告李四因买卖合同产生纠纷，被告未按约定支付货款', 0, '2024-01-15', NULL, NULL, '审理中', 500000.00, '深圳市南山区科技园', '91440300123456789X', '李四', '李四', '张律师', '双方于2023年12月签订买卖合同，被告未按约定支付货款', '2024-01-10', '深圳市南山区人民法院', 25000.00, '请求判令被告支付货款50万元及利息', '张三', '深圳市福田区中心区', '91440300987654321Y', '张三', '张三');
INSERT INTO `case_management` VALUES (7, '2024民初002', '建设工程纠纷', '王五诉赵六建设工程施工合同纠纷案', '原告王五与被告赵六因建设工程施工合同产生纠纷，涉及工程质量问题', 0, '2024-02-20', NULL, NULL, '调解中', 2000000.00, '东西湖区台商投资区东吴大道特1号,武汉市关山路552号,深圳市光明区凤凰街道凤凰社区科裕路168号华星半导体显示工业园13栋研发办公楼一层', '914201007483157744,91420000757013137P,91440300MA5DFAEB6U', '万大勇,陈卫国,KIM WOO SHIK', '中建三局第一建设工程有限责任公司,中建三局集团有限公司,深圳市华星光电半导体显示技术有限公司', '李律师', '被告一因承建\"第11代超高清新型显示器件生产线项目施工总承包A标段\"项目，与原告签订《第11代超高清新型显示器件生产线项目施工总承包A标段商品砼及预拌砂浆购销合同》（以下简称\"合同\"）,合同对价格、货物结算、付款方式及争议解决方式进行了约定。合同签订后，原告严格按照合同约定向被告供应货物，但被告一却未按合同约定向原告及时支付货款，截至2022年4月24日，被告一尚欠原告货款2,562,328.12元未予支付，已构成严重违约。故被告一除应向原告支付货款2,562,328.12元以外，还应向原告支付截至2022年4月24日的逾期付款损失545,901.67元，并按日万分之五的标准支付自2022年4月25日起至货款全部付清之日止的后续逾期付款损失。被告二作为被告一的唯一股东，根据《公司法》第六十三条之规定，一人有限责任公司的股东不能证明公司财产独立于股东自己的财产的，应对公司债务承担连带责任。被告三系案涉项目的建设单位，其作为最终受益人，应对被告一的上述债务承担连带清偿责任。对于上述款项，原告多次催要，三被告均不予支付。鉴此，为维护原告的合法权益，依据我国有关法律，特具状贵院，恳请支持。', '2022-04-24', '____________人民法院', 100000.00, '判令被告一向原告支付货款2,562,328.12元;判令被告一向原告支付截至2022年4月24日的逾期付款损失545,901.67元，并以欠付货款为基数，按日万分之五的标准支付自2022年4月25日起至货款付清之日止的后续逾期付款损失;(上述1-2项暂合计3,108,229.79元）判令被告二、被告三对被告一的上述债务承担连带清偿责任；判令三被告承担本案案件受理费、财产保全费、财产保全担保费。', '深圳市振惠建混凝土有限公司', '深圳市光明区凤凰街道塘尾社区光明大道中3号1栋一层', '91440300743220274C', '刘晓峰', '深圳市振惠建混凝土有限公司');
