INSERT INTO `case_management` VALUES (10, '2024民初006', '合同纠纷', '房屋租赁合同纠纷案', '承租人提前解除租赁合同，要求返还押金及违约金', 0, '2024-04-15', '案件已立案，等待开庭', NULL, '待处理', 180000.00, '北京市朝阳区建国路88号SOHO现代城', '91110105677766554A', '左晖', '北京链家房地产经纪有限公司', '张律师', '原告与被告于2023年5月1日签订房屋租赁合同，约定租期3年。因房屋质量问题，原告多次要求维修未果，于2024年3月提前解除合同。', '2024-04-15', '北京市朝阳区人民法院', 15000.00, '1. 判令被告返还押金人民币30000元；2. 判令被告支付违约金人民币50000元；3. 判令被告承担本案诉讼费用。', '李明', '北京市朝阳区望京西路100号', '', '', '李明');
