INSERT INTO `case_management` VALUES (12, '2024民初008', '交通事故', '机动车交通事故责任纠纷案', '交通事故导致人身损害，要求赔偿医疗费、误工费等', 0, '2024-08-20', '已进行伤残鉴定', NULL, '进行中', 350000.00, '深圳市坪山区比亚迪路3009号', '91440300192433909K', '王传福', '深圳市比亚迪汽车有限公司', '李律师', '2024年6月15日，被告驾驶员驾驶车辆在深南大道与原告驾驶的电动车发生碰撞，导致原告受伤住院治疗3个月。交警认定被告负全责。', '2024-08-20', '深圳市宝安区人民法院', 25000.00, '1. 判令被告赔偿医疗费80000元；2. 判令被告赔偿误工费50000元；3. 判令被告赔偿护理费20000元；4. 判令被告赔偿精神损害抚慰金50000元；5. 其他费用合计150000元。', '陈晓', '深圳市宝安区新安街道建安一路100号', '', '', '陈晓');
INSERT INTO `case_management` VALUES (13, '2024民初009', '知识产权', '商标侵权纠纷案', '被告未经许可使用原告注册商标进行商业活动', 0, '2024-07-10', '已申请诉前保全', NULL, '待处理', 5000000.00, '深圳市南山区科技南十路999号', '91440300123456789A', '张伟', '深圳市某科技有限公司', '赵律师', '原告于2015年注册\"网易云音乐\"商标，被告自2023年起在其APP中使用近似商标\"网易云乐\"，侵犯原告商标专用权，造成市场混淆。', '2024-07-10', '广州市中级人民法院', 300000.00, '1. 判令被告立即停止侵权行为；2. 判令被告赔偿经济损失500万元；3. 判令被告公开赔礼道歉；4. 判令被告承担诉讼费用。', '网易公司法务部', '广州市天河区科韵路16号', '914401017172929117', '丁磊', '广州网易计算机系统有限公司');
INSERT INTO `case_management` VALUES (14, '2024民初010', '金融借款', '民间借贷纠纷案', '借款人未按约定归还借款本金及利息', 0, '2024-05-20', '判决已生效', '判令被告归还本金及利息', '已结案', 1500000.00, '杭州市西湖区文三路100号', '', '王建国', '王建国', '孙律师', '原告与被告于2023年1月签订借款合同，约定借款150万元，年利率12%，期限1年。到期后被告仅归还本金50万元，剩余本息未还。', '2024-05-20', '杭州市西湖区人民法院', 50000.00, '1. 判令被告归还借款本金100万元；2. 判令被告支付利息及逾期利息共计50万元；3. 判令被告承担诉讼费用。', '阿里巴巴法务部', '杭州市余杭区文一西路969号', '91330108743256051M', '张勇', '阿里巴巴网络技术有限公司');
INSERT INTO `case_management` VALUES (15, '2024民初011', '物业服务', '物业服务合同纠纷案', '业主拒缴物业费，物业公司提起诉讼', 0, '2024-09-15', '开庭时间已确定', NULL, '进行中', 280000.00, '成都市武侯区锦绣路100号小区', '', '', '业主委员会', '钱律师', '被告所在小区业主自2023年7月起拒绝缴纳物业费，理由是物业服务质量差。原告多次催缴未果，累计欠费28万元。', '2024-09-15', '成都市武侯区人民法院', 20000.00, '1. 判令被告支付物业费280000元；2. 判令被告支付滞纳金28000元；3. 判令被告承担诉讼费用。', '成都万科物业法务部', '成都市武侯区天府大道中段666号', '91510107MA6CL8Q05X', '朱保全', '成都万科物业服务有限公司');
INSERT INTO `case_management` VALUES (16, '2024民初012', '买卖合同', '商品房买卖合同纠纷案', '开发商逾期交房，购房者要求赔偿', 0, '2024-07-25', '等待法院排期', NULL, '待处理', 3200000.00, '武汉市江汉区解放大道300号', '', '', '李娜', '周律师', '原告于2022年5月购买被告开发的商品房一套，合同约定2023年12月31日交房。但至2024年6月仍未交房，逾期半年。', '2024-07-25', '武汉市江汉区人民法院', 80000.00, '1. 判令被告支付逾期交房违约金192000元（按日万分之一计算）；2. 判令被告于判决生效后30日内交付房屋；3. 判令被告承担诉讼费用。', '李娜', '武汉市江汉区建设大道558号', '91420103MA4KL6YY4P', '张玉良', '武汉绿地中心置业有限公司');
INSERT INTO `case_management` VALUES (17, '2024民初013', '合同纠纷', '装修合同纠纷案', '装修质量不合格，业主要求返工并赔偿损失', 0, '2024-08-30', '质量鉴定报告已出', NULL, '进行中', 450000.00, '南京市鼓楼区江东北路200号', '', '', '张红', '吴律师', '原告与被告于2023年8月签订装修合同，约定装修费用45万元。装修完工后发现多处质量问题：墙面开裂、地板不平、水电布线不规范等。', '2024-08-30', '南京市鼓楼区人民法院', 30000.00, '1. 判令被告返工整改至符合国家标准；2. 判令被告赔偿经济损失100000元；3. 判令被告承担诉讼费用。', '张红', '南京市鼓楼区中央路100号', '91320106MA1ML3XY8H', '陈建', '南京某装饰工程有限公司');
INSERT INTO `case_management` VALUES (18, '2024民初014', '著作权', '著作权侵权纠纷案', '被告未经授权使用原告音乐作品', 0, '2024-09-20', '证据保全已完成', NULL, '待处理', 2000000.00, '深圳市福田区华强北路500号', '91440300987654321B', '刘某', '某网络公司', '郑律师', '原告拥有多首流行音乐作品的著作权。被告在其短视频平台上大量使用原告作品，未支付版权费用，侵犯原告著作权。', '2024-09-20', '深圳市福田区人民法院', 150000.00, '1. 判令被告立即停止侵权行为；2. 判令被告赔偿经济损失200万元；3. 判令被告公开赔礼道歉；4. 判令被告承担诉讼费用。', '腾讯音乐法务部', '深圳市南山区高新科技园北区腾讯大厦', '91440300359714277Q', '彭迦信', '深圳市腾讯音乐娱乐科技有限公司');
INSERT INTO `case_management` VALUES (19, '2024民初015', '产品责任', '产品质量责任纠纷案', '食品质量问题导致消费者集体中毒', 0, '2024-06-30', '行政处罚已下达', NULL, '进行中', 500000.00, '天津市和平区建设路50号', '', '', '消费者协会', '冯律师', '2024年5月，被告生产的某品牌速冻水饺因细菌超标导致50余名消费者食用后出现腹泻、呕吐等症状。市场监督管理局已对被告立案调查。', '2024-06-30', '天津市和平区人民法院', 40000.00, '1. 判令被告赔偿医疗费、误工费等经济损失共计50万元；2. 判令被告支付惩罚性赔偿金50万元；3. 判令被告公开赔礼道歉；4. 判令被告承担诉讼费用。', '消费者协会', '天津市和平区南京路100号', '91120101MA06ABC123', '赵强', '天津某食品有限公司');
INSERT INTO `case_management` VALUES (20, '2024民初016', '股权转让', '股权转让纠纷案', '股权转让协议履行纠纷', 0, '2024-08-15', '已申请财产保全', NULL, '待处理', 8000000.00, '苏州市工业园区星华街200号', '91320500654321987C', '王科技', '苏州某科技公司', '陈律师', '原告与被告于2023年10月签订股权转让协议，约定原告以800万元收购被告持有的某科技公司20%股权。协议签订后原告已支付500万元，但被告拒不配合办理股权变更登记。', '2024-08-15', '苏州市工业园区人民法院', 200000.00, '1. 判令被告履行股权转让协议，办理股权变更登记手续；2. 判令被告支付违约金80万元；3. 判令被告承担诉讼费用。', '李投资', '苏州市工业园区星湖街188号', '91320594MA1PQRST2U', '李投资', '苏州某投资管理有限公司');
INSERT INTO `case_management` VALUES (21, '2024民初017', '加盟合同', '特许经营合同纠纷案', '加盟商要求解除合同并返还加盟费', 0, '2024-09-10', '调解未果，继续审理', NULL, '进行中', 350000.00, '重庆市渝中区较场口300号', '', '', '李加盟商', '褚律师', '原告于2023年3月与被告签订特许经营合同，支付加盟费35万元。经营半年后发现被告提供的经营指导严重不符，且品牌支持、货源供应等承诺均未兑现，导致持续亏损。', '2024-09-10', '重庆市渝中区人民法院', 35000.00, '1. 判令解除特许经营合同；2. 判令被告返还加盟费350000元；3. 判令被告赔偿经济损失200000元；4. 判令被告承担诉讼费用。', '李加盟商', '重庆市渝中区解放碑步行街100号', '91500103MA5UMNOP6V', '杨餐饮', '重庆某餐饮管理有限公司');
INSERT INTO `case_management` VALUES (22, '2024民初018', '医疗纠纷', '医疗损害责任纠纷案', '医疗过错导致患者死亡，家属要求赔偿', 0, '2024-07-05', '医疗鉴定报告已出具', NULL, '进行中', 800000.00, '西安市新城区解放路100号', '', '', '患者家属', '卫律师', '患者于2024年3月因急性心梗入院治疗，医院在诊疗过程中存在延误救治、用药不当等过错，最终导致患者死亡。经医疗事故鉴定，医院承担主要责任。', '2024-07-05', '西安市新城区人民法院', 60000.00, '1. 判令被告赔偿死亡赔偿金600000元；2. 判令被告赔偿精神损害抚慰金200000元；3. 判令被告承担丧葬费等其他费用；4. 判令被告承担诉讼费用。', '患者家属代表', '西安市新城区长乐西路127号', '91610102000111222W', '院长李某', '西安某三甲医院');
INSERT INTO `case_management` VALUES (23, '2024民初019', '环境污染', '环境污染责任纠纷案', '化工厂排放污染物影响周边居民生活', 0, '2024-08-25', '环境检测报告已提交', NULL, '待处理', 3000000.00, '长沙市岳麓区银盆岭街道200号', '', '', '周边居民', '蒋律师', '被告化工厂长期违规排放废气废水，导致周边居民身体健康受损、农作物减产、生活环境恶化。环保部门已对被告进行处罚，但污染问题未得到根本解决。', '2024-08-25', '长沙市岳麓区人民法院', 100000.00, '1. 判令被告立即停止污染行为；2. 判令被告恢复环境原状或赔偿环境修复费用300万元；3. 判令被告赔偿居民损失合计200万元；4. 判令被告承担诉讼费用。', '居民代表', '长沙市岳麓区麓谷大道100号', '91430104MA4L5XYZ7W', '周厂长', '长沙某化工有限公司');
INSERT INTO `case_management` VALUES (24, '2024民初020', '继承纠纷', '法定继承纠纷案', '多名继承人对遗产分配存在争议', 0, '2024-06-20', '遗产清单已确定', NULL, '进行中', 5000000.00, '郑州市金水区政七街100号', '', '', '继承人张大', '韩律师', '被继承人张老先生于2024年2月去世，留有房产3套、存款200万、股票市值300万。张老先生生前未立遗嘱，法定继承人包括配偶、两个子女及父母。继承人对遗产分配方案无法达成一致。', '2024-06-20', '郑州市金水区人民法院', 80000.00, '1. 依法分割被继承人张老先生的遗产；2. 判令各继承人按法定继承顺序和份额继承遗产；3. 判令诉讼费用由遗产承担。', '张大', '', '', '', '');
INSERT INTO `case_management` VALUES (25, '2024民初021', '保险合同', '保险合同纠纷案', '保险公司拒赔车辆损失，投保人提起诉讼', 0, '2024-09-18', '血检报告已提交', NULL, '待处理', 450000.00, '青岛市市南区香港中路100号', '', '', '车主刘某', '魏律师', '原告于2023年在被告处投保车辆全险。2024年7月发生交通事故，车辆损失45万元。保险公司以\"酒驾\"为由拒赔，但原告血检结果显示血液酒精含量未超标，不构成酒驾。', '2024-09-18', '青岛市市南区人民法院', 35000.00, '1. 判令被告支付保险赔偿金450000元；2. 判令被告支付迟延履行利息；3. 判令被告承担诉讼费用。', '刘某', '深圳市福田区福田街道益田路5033号', '91440300190363206G', '任汇川', '中国平安财产保险股份有限公司');
INSERT INTO `case_management` VALUES (26, '2024民初022', '不正当竞争', '不正当竞争纠纷案', '被告通过虚假宣传、恶意诋毁等手段进行不正当竞争', 0, '2024-10-10', '证据材料丰富', NULL, '待处理', 10000000.00, '宁波市海曙区药行街200号', '91330203789456123D', '李科技', '宁波某科技公司', '姜律师', '原告与被告均从事同类产品销售。被告通过散布虚假信息、雇佣水军恶意差评、仿冒包装等手段，严重损害原告商业信誉，导致原告销售额大幅下降。', '2024-10-10', '宁波市海曙区人民法院', 300000.00, '1. 判令被告立即停止不正当竞争行为；2. 判令被告赔偿经济损失1000万元；3. 判令被告公开赔礼道歉，消除影响；4. 判令被告承担诉讼费用。', '宁波某电商公司法务部', '宁波市海曙区中山西路100号', '91330203MA283DEF4X', '陈电商', '宁波某电商有限公司');
INSERT INTO `case_management` VALUES (27, '2024民初023', '离婚纠纷', '离婚纠纷案', '夫妻感情破裂，女方起诉离婚并要求分割财产', 0, '2024-09-28', '财产清单已提交', NULL, '进行中', 0.00, '福州市鼓楼区五一北路100号', '', '', '李女士', '施律师', '原告与张先生于2015年结婚，婚后育有一女。因双方性格不合，经常发生争吵，感情已完全破裂，分居已满一年。现原告起诉要求离婚，并要求分割夫妻共同财产（房产、存款等）及确定子女抚养权。', '2024-09-28', '福州市鼓楼区人民法院', 15000.00, '1. 判令原告与张先生离婚；2. 依法分割夫妻共同财产；3. 判定女儿由原告抚养，被告每月支付抚养费3000元；4. 判令诉讼费用由双方各半承担。', '李女士', '', '', '', '');
INSERT INTO `case_management` VALUES (28, '2024民初024', '建设工程', '建设工程施工合同纠纷案', '工程款结算纠纷及质量保证金返还问题', 0, '2024-08-08', '工程审计报告已出', NULL, '进行中', 15000000.00, '济南市历下区泉城路5000号', '91370102555666777F', '王董事长', '济南某房地产开发有限公司', '余律师', '原告承建被告开发的住宅项目，工程已于2023年12月竣工验收合格并交付使用。但被告以各种理由拖欠工程款1500万元及质量保证金300万元至今未支付。', '2024-08-08', '济南市历下区人民法院', 500000.00, '1. 判令被告支付拖欠工程款15000000元；2. 判令被告支付质量保证金3000000元；3. 判令被告支付逾期付款利息；4. 判令被告承担诉讼费用。', '山东某建筑集团法务部', '济南市历下区经十路12345号', '91370100777888999E', '刘总经理', '山东某建筑集团有限公司');
INSERT INTO `case_management` VALUES (29, '2024民初025', '网络侵权', '网络侵权责任纠纷案', '网络主播直播中侵害企业名誉权', 0, '2024-10-15', '视频证据已保全', NULL, '待处理', 2000000.00, '厦门市思明区莲前东路200号', '', '', '某网络主播', '许律师', '被告在其网络直播中多次发表针对原告企业的不实言论，称原告产品为\"三无产品\"、\"黑心企业\"等，严重损害原告商业信誉。相关视频播放量超过500万次，造成恶劣影响。', '2024-10-15', '厦门市思明区人民法院', 100000.00, '1. 判令被告立即删除侵权视频并停止侵权行为；2. 判令被告在相关平台公开赔礼道歉，持续时间不少于30天；3. 判令被告赔偿经济损失200万元；4. 判令被告承担诉讼费用。', '厦门某网络科技公司法务部', '厦门市思明区软件园二期观日路100号', '91350203MA2Y6GHI8J', '黄总', '厦门某网络科技有限公司');
INSERT INTO `case_management` VALUES (30, '2024民初026', '债权债务', '民间借贷纠纷案', '借款人拒不归还借款，债权人要求清偿', 0, '2024-09-05', '已查封被告名下财产', NULL, '进行中', 600000.00, '石家庄市长安区裕华东路200号', '', '', '赵某', '李律师', '原告于2022年向被告出借60万元，约定年利率10%，借款期限2年。到期后被告拒不还款，现原告要求被告偿还本金及利息。', '2024-09-05', '石家庄市长安区人民法院', 30000.00, '1. 判令被告偿还借款本金60万元；2. 判令被告支付利息12万元；3. 判令被告支付逾期利息；4. 判令被告承担诉讼费用。', '张某', '石家庄市长安区中山东路100号', '', '', '张某');
INSERT INTO `case_management` VALUES (31, '2024民初027', '房屋买卖', '二手房买卖合同纠纷案', '卖方隐瞒房屋重大瑕疵，买方要求解除合同', 0, '2024-10-01', '房屋质量鉴定中', NULL, '待处理', 2800000.00, '杭州市滨江区江南大道3000号', '', '', '王某', '陈律师', '原告于2024年5月购买被告的二手房，交易价格280万元。入住后发现房屋存在严重漏水、墙体开裂等问题，被告在交易时故意隐瞒。', '2024-10-01', '杭州市滨江区人民法院', 60000.00, '1. 判令解除房屋买卖合同；2. 判令被告返还购房款280万元；3. 判令被告赔偿装修损失20万元；4. 判令被告承担诉讼费用。', '李某', '杭州市滨江区滨盛路100号', '', '', '李某');
INSERT INTO `case_management` VALUES (32, '2024民初028', '侵权责任', '高空抛物致人损害责任纠纷案', '高空坠物砸伤行人，受害人要求赔偿', 0, '2024-08-18', '物业监控已调取', NULL, '进行中', 350000.00, '深圳市南山区科技园南区某小区', '', '', '某小区业主', '刘律师', '原告2024年7月路经被告小区楼下时，被从高层坠落的花盆砸伤头部，造成重伤。经警方调查未能确定具体抛物者，根据法律规定由可能造成损害的建筑物使用人承担责任。', '2024-08-18', '深圳市南山区人民法院', 40000.00, '1. 判令被告业主（可能加害人）连带赔偿医疗费、误工费等损失35万元；2. 判令物业公司承担相应的补充责任；3. 判令被告承担诉讼费用。', '张某', '深圳市南山区科技园南区', '', '', '张某');
INSERT INTO `case_management` VALUES (33, '2024民初029', '知识产权', '专利侵权纠纷案', '被告生产销售侵犯原告专利权的产品', 0, '2024-09-25', '专利有效性已确认', NULL, '待处理', 8000000.00, '苏州市工业园区苏州大道西300号', '91320500ABC123DEF4', '李某', '苏州某机械公司', '周律师', '原告于2018年取得\"自动化生产线控制系统\"发明专利。被告自2022年起未经许可生产、销售侵犯该专利的产品，获利巨大。', '2024-09-25', '苏州市中级人民法院', 400000.00, '1. 判令被告立即停止侵权行为；2. 判令被告销毁侵权产品及模具；3. 判令被告赔偿经济损失800万元；4. 判令被告公开赔礼道歉；5. 判令被告承担诉讼费用。', '华为公司知识产权部', '深圳市龙岗区坂田华为基地', '91440300743220274D', '任某', '华为技术有限公司');
INSERT INTO `case_management` VALUES (34, '2024民初030', '劳动争议', '工伤赔偿纠纷案', '员工工作期间受伤，要求公司支付工伤待遇', 0, '2024-07-28', '工伤认定已完成', NULL, '进行中', 450000.00, '东莞市长安镇某工业区', '', '', '某制造公司', '张律师', '原告在被告工厂工作期间操作机器时，因设备故障导致右手三指被切断。经认定为工伤，构成七级伤残，但被告拒不支付工伤赔偿。', '2024-07-28', '东莞市第一人民法院', 35000.00, '1. 判令被告支付一次性伤残补助金15万元；2. 判令被告支付一次性工伤医疗补助金10万元；3. 判令被告支付一次性伤残就业补助金20万元；4. 判令被告支付医疗费、护理费等费用；5. 判令被告承担诉讼费用。', '李某', '东莞市长安镇某村', '', '', '李某');
INSERT INTO `case_management` VALUES (35, '2024民初031', '婚姻家庭', '离婚后财产纠纷案', '离婚后发现隐匿财产，要求重新分割', 0, '2024-09-12', '调查取证中', NULL, '待处理', 3000000.00, '南京市玄武区龙蟠中路100号', '', '', '前夫刘某', '王律师', '原告与被告于2023年协议离婚，当时被告称仅有存款50万元。离婚后原告发现被告在婚姻存续期间购买的多处房产及股票账户，价值超过300万元，故起诉要求重新分割。', '2024-09-12', '南京市玄武区人民法院', 70000.00, '1. 判令重新分割夫妻共同财产；2. 判令被告向原告支付应得财产份额150万元；3. 判令被告赔偿隐匿财产的损失；4. 判令被告承担诉讼费用。', '陈某', '南京市玄武区中山路200号', '', '', '陈某');
INSERT INTO `case_management` VALUES (36, '2024民初032', '商事合同', '股东出资纠纷案', '股东未按约定缴纳出资，公司要求履行出资义务', 0, '2024-08-30', '验资报告已提交', NULL, '进行中', 5000000.00, '成都市高新区天府大道中段1号', '91510100MA6YZ1234P', '张某', '张某', '李律师', '被告作为公司股东，认缴出资500万元，应于2024年3月前缴足。但截至起诉日，被告仅实缴100万元，剩余400万元未缴纳，严重影响公司正常运营。', '2024-08-30', '成都市高新区人民法院', 120000.00, '1. 判令被告向公司缴纳剩余出资400万元；2. 判令被告支付延迟出资的利息；3. 判令被告承担诉讼费用。', '成都某科技公司', '成都市高新区天府大道中段999号', '91510100ABC456789X', '李某', '成都某科技有限公司');
INSERT INTO `case_management` VALUES (37, '2024民初033', '侵权责任', '名誉权纠纷案', '被告在网络平台发布不实言论，侵害原告名誉权', 0, '2024-10-08', '网络证据已公证保全', NULL, '待处理', 500000.00, '广州市天河区某网络平台', '', '', '某网络用户', '赵律师', '被告在微博、抖音等多个平台发布针对原告的不实言论，称原告\"学历造假\"、\"商业欺诈\"等，相关帖子阅读量超过1000万次，严重损害原告的社会评价和商业信誉。', '2024-10-08', '广州市天河区人民法院', 50000.00, '1. 判令被告立即删除侵权内容并停止侵权；2. 判令被告在相关平台公开赔礼道歉，持续时间不少于30天；3. 判令被告赔偿精神损害抚慰金50万元；4. 判令被告承担诉讼费用。', '王某', '广州市天河区珠江新城某大厦', '', '', '王某');
INSERT INTO `case_management` VALUES (38, '2024民初034', '合同纠纷', '融资租赁合同纠纷案', '承租人逾期支付租金，出租人要求解除合同', 0, '2024-09-20', '设备已查封', NULL, '进行中', 12000000.00, '天津市滨海新区某工业园', '91120116XYZ789012M', '赵某', '天津某重工企业', '孙律师', '原告与被告签订融资租赁合同，向被告出租大型生产设备，总价值1200万元，租期5年。被告已支付2年租金后，连续6个月未支付租金，已构成严重违约。', '2024-09-20', '天津市滨海新区人民法院', 150000.00, '1. 判令解除融资租赁合同；2. 判令被告返还租赁设备；3. 判令被告支付拖欠租金及违约金；4. 判令被告赔偿设备贬值损失；5. 判令被告承担诉讼费用。', '中国某融资租赁公司', '上海市浦东新区陆家嘴环路1000号', '91310115MA1K5678XX', '李某', '中国某融资租赁有限公司');
INSERT INTO `case_management` VALUES (39, '2024民初035', '侵权责任', '饲养动物损害责任纠纷案', '宠物狗咬伤他人，狗主人被诉赔偿', 0, '2024-08-15', '动物防疫证明已调取', NULL, '已结案', 85000.00, '长沙市岳麓区某小区', '', '', '犬只主人王某', '周律师', '原告在小区散步时，被被告饲养的大型犬咬伤腿部，造成十级伤残。被告未对犬只采取安全措施，且犬只未办理养犬登记证。', '2024-08-15', '长沙市岳麓区人民法院', 15000.00, '1. 判令被告赔偿医疗费3万元；2. 判令被告赔偿误工费2万元；3. 判令被告赔偿伤残赔偿金25万元；4. 判令被告赔偿精神损害抚慰金5000元；5. 判令被告承担诉讼费用。', '刘某', '长沙市岳麓区某小区', '', '', '刘某');
INSERT INTO `case_management` VALUES (40, '2024民初036', '知识产权', '商业秘密侵权纠纷案', '离职员工泄露商业秘密，原公司要求赔偿', 0, '2024-10-12', '电子证据已鉴定', NULL, '待处理', 15000000.00, '深圳市南山区高新南四道某公司', '91440300DEF456789G', '李某', '李某', '郑律师', '被告曾任原告公司技术总监，掌握公司核心技术秘密。离职后被告加入竞争对手公司，并将原告的客户信息、技术资料等商业秘密提供给新公司使用，给原告造成巨大经济损失。', '2024-10-12', '深圳市中级人民法院', 500000.00, '1. 判令被告立即停止侵权行为；2. 判令被告返还或销毁涉密资料；3. 判令被告赔偿经济损失1500万元；4. 判令被告新任职公司承担连带责任；5. 判令被告承担诉讼费用。', '深圳某软件公司', '深圳市南山区高新南四道18号', '91440300ABC123456H', '张某', '深圳某软件有限公司');
INSERT INTO `case_management` VALUES (41, '2024民初037', '合同纠纷', '汽车买卖合同纠纷案', '新车存在质量问题，消费者要求退车退款', 0, '2024-09-08', '车辆质量检测报告已出具', NULL, '进行中', 450000.00, '北京市朝阳区某4S店', '91110105GHI789012J', '刘某', '某汽车销售公司', '吴律师', '原告于2024年6月从被告处购买某品牌新车一辆，价格45万元。提车后一个月内发动机出现严重异响，变速箱频繁故障，经检测属于出厂时即存在的质量问题。', '2024-09-08', '北京市朝阳区人民法院', 40000.00, '1. 判令解除汽车买卖合同；2. 判令被告退还购车款45万元；3. 判令被告按购车款三倍支付赔偿金135万元（适用消费者权益保护法）；4. 判令被告承担诉讼费用。', '王某', '北京市朝阳区建国路88号', '', '', '王某');
INSERT INTO `case_management` VALUES (42, '2024民初038', '劳动争议', '竞业限制纠纷案', '员工违反竞业限制协议，公司要求赔偿', 0, '2024-10-05', '调查取证完成', NULL, '待处理', 2000000.00, '杭州市滨江区某科技园', '91330108JKL456789K', '陈某', '陈某', '钱律师', '被告原系原告公司高管，双方签订有竞业限制协议，约定离职后2年内不得到竞争对手处任职。但被告离职后3个月即入职直接竞争对手公司担任同类职位。', '2024-10-05', '杭州市滨江区人民法院', 80000.00, '1. 判令被告继续履行竞业限制义务；2. 判令被告返还已支付的竞业限制补偿金30万元；3. 判令被告支付违约金200万元；4. 判令被告承担诉讼费用。', '杭州某互联网公司', '杭州市滨江区江南大道3588号', '91330108MNO123456L', '马某', '杭州某互联网有限公司');
INSERT INTO `case_management` VALUES (43, '2024民初039', '侵权责任', '个人信息保护纠纷案', 'APP非法收集使用个人信息，用户起诉维权', 0, '2024-10-18', '技术鉴定中', NULL, '待处理', 100000.00, '上海市浦东新区某科技公司', '91310115PQR789012M', '周某', '某APP运营公司', '施律师', '被告开发的某APP在未经用户同意的情况下，收集用户通讯录、位置信息、浏览记录等敏感个人信息，并向第三方出售获利。原告代表受害用户提起公益诉讼。', '2024-10-18', '上海市浦东新区人民法院', 50000.00, '1. 判令被告停止非法收集、使用个人信息的行为；2. 判令被告删除已收集的非法个人信息；3. 判令被告向每位受害用户支付赔偿金1000元；4. 判令被告公开赔礼道歉；5. 判令被告承担诉讼费用。', '消费者权益保护协会', '上海市黄浦区南京东路100号', '', '', '消费者权益保护协会');
INSERT INTO `case_management` VALUES (44, '2024民初040', '合同纠纷', '教育培训合同纠纷案', '培训机构虚假宣传，学员要求退费', 0, '2024-09-22', '广告宣传材料已保全', NULL, '进行中', 89800.00, '广州市天河区某教育培训机构', '91440106STU456789N', '张某', '某教育科技公司', '蒋律师', '被告宣传称\"保证学员年薪50万\"、\"不过包退\"等，原告缴纳培训费8.98万元参加培训。培训质量差，师资与宣传严重不符，且结业后未能实现承诺的就业效果。', '2024-09-22', '广州市天河区人民法院', 20000.00, '1. 判令解除教育培训合同；2. 判令被告退还培训费89800元；3. 判令被告按培训费三倍赔偿269400元（虚假宣传）；4. 判令被告承担诉讼费用。', '李某', '广州市天河区天河路100号', '', '', '李某');
INSERT INTO `case_management` VALUES (45, '2024民初041', '侵权责任', '网络游戏虚拟财产纠纷案', '游戏账号被盗，玩家要求游戏公司赔偿', 0, '2024-10-20', '游戏数据已调取', NULL, '待处理', 180000.00, '上海市徐汇区某游戏公司', '91310104VWX123456O', '运营公司', '某网络游戏公司', '韩律师', '原告游戏账号内虚拟财产价值18万元被盗，原告多次向被告公司申诉要求找回，但被告以\"玩家自行保管密码\"为由拒绝承担责任。经查明系被告公司服务器存在安全漏洞导致。', '2024-10-20', '上海市徐汇区人民法院', 30000.00, '1. 判令被告恢复原告账号内的虚拟财产；2. 如无法恢复，判令被告赔偿原告损失18万元；3. 判令被告赔偿精神损害抚慰金2万元；4. 判令被告承担诉讼费用。', '游戏玩家张某', '上海市徐汇区某小区', '', '', '张某');
INSERT INTO `case_management` VALUES (46, '2024民初042', '合同纠纷', '农村土地承包经营权纠纷案', '承包方擅自改变土地用途，发包方要求解除合同', 0, '2024-08-28', '实地勘察已完成', NULL, '进行中', 500000.00, '济南市长清区某村', '', '', '某农业公司', '余律师', '被告承包原告村集体土地200亩用于农业种植，承包期20年。但被告擅自将土地改建为养殖场和仓储设施，严重违反土地承包合同约定及土地管理法规定。', '2024-08-28', '济南市长清区人民法院', 35000.00, '1. 判令解除土地承包经营合同；2. 判令被告恢复土地原状；3. 判令被告支付违约金50万元；4. 判令被告承担诉讼费用。', '某村村民委员会', '济南市长清区某村', '', '', '某村村民委员会');
INSERT INTO `case_management` VALUES (47, '2024民初043', '金融借款', '信用卡纠纷案', '持卡人恶意透支，银行要求偿还欠款', 0, '2024-09-30', '银行流水已提交', NULL, '待处理', 280000.00, '深圳市福田区某银行网点', '', '', '持卡人刘某', '魏律师', '被告持有原告银行信用卡，长期恶意透支。截至2024年8月，欠款本金28万元，利息及滞纳金5.6万元，经多次催收无果。', '2024-09-30', '深圳市福田区人民法院', 25000.00, '1. 判令被告偿还信用卡欠款本金28万元；2. 判令被告支付利息及滞纳金5.6万元；3. 判令被告承担诉讼费用。', '某商业银行', '深圳市福田区福华一路100号', '91440300YZA789012P', '行长王某', '某商业银行股份有限公司');
INSERT INTO `case_management` VALUES (48, '2024民初044', '侵权责任', '肖像权纠纷案', '商家未经同意使用他人肖像做广告，被诉侵权', 0, '2024-10-22', '侵权广告已拍照保全', NULL, '待处理', 300000.00, '厦门市思明区某商场', '91350203BCD456789Q', '商场经营者', '某服装品牌', '许律师', '被告未经原告同意，将原告照片用于店铺广告牌、宣传海报及线上推广，用于商业宣传长达半年。原告系知名模特，具有一定社会知名度，被告的行为严重侵害原告肖像权。', '2024-10-22', '厦门市思明区人民法院', 40000.00, '1. 判令被告立即停止侵权行为；2. 判令被告公开赔礼道歉；3. 判令被告赔偿经济损失30万元；4. 判令被告承担诉讼费用。', '模特李某', '厦门市思明区环岛路某小区', '', '', '李某');
INSERT INTO `case_management` VALUES (49, '2024民初045', '合同纠纷', '演出合同纠纷案', '艺人违约拒不履行演出义务，主办方要求赔偿', 0, '2024-10-25', '合同及转账记录已提交', NULL, '待处理', 5000000.00, '北京市朝阳区某演出公司', '91110105EFG123456R', '某艺人', '某艺人工作室', '姜律师', '原告与被告签订演出合同，约定被告于2024年10月在北京举办演唱会，演出费500万元已全额支付。但被告以\"身体不适\"为由单方取消演出，给原告造成巨大经济损失。', '2024-10-25', '北京市朝阳区人民法院', 200000.00, '1. 判令被告履行演出合同或支付违约金500万元；2. 判令被告赔偿原告场地费、宣传费等损失200万元；3. 判令被告承担诉讼费用。', '某演出公司', '北京市朝阳区建国路100号', '91110105HIJ789012S', '张某', '某演出有限公司2');
INSERT INTO `case_management` VALUES (50, '(2024)粤万方深龙01民其字第008号', '民事纠纷', '广东立群建筑劳务有限公司vs中铁十九局集团第五工程有限公司（第三人：东莞市易发混凝土有限公司）', NULL, 0, NULL, NULL, NULL, 'filed', 48000.00, '', '92XXXXXXXXX', '', 'XX 市 XX 区 XX 建材经营部', NULL, '', '2025-05-05', '', NULL, '', '张三甲', '深圳南山西丽', '', '张三甲', '张三甲');
