INSERT INTO `lsl_system_operation_log` VALUES (37, NULL, NULL, NULL, '2025-10-17 09:46:50.911662', '2025-10-17 09:46:50.811582', '案例管理', '/api/case/cases/5/expert_generate/', '{\'analysis_result\': {\'expert_response\': \'```json\\n{\\n  \"analysis\": {\\n    \"8\": {\\n      \"placeholders\": {\\n        \"plaintiff_name\": \"深圳市振惠建混凝土有限公司\",\\n        \"plaintiff_address\": \"深圳市光明区凤凰街道塘尾社区光明大道中3号1栋一层\",\\n        \"plaintiff_credit_code\": \"91440300743220274C\",\\n        \"plaintiff_legal_representative\": \"刘晓峰\",\\n        \"defendant_name\": \"中建三局第一建设工程有限责任公司、中建三局集团有限公司、深圳市华星光电半导体显示技术有限公司\",\\n        \"defendant_address\": \"东西湖区台商投资区东吴大道特1号、武汉市关山路552号、深圳市光明区凤凰街道凤凰社区科裕路168号华星半导体显示工业园13栋研发办公楼一层\",\\n        \"defendant_credit_code\": \"914201007483157744、91420000757013137P、91440300MA5DFAEB6U\",\\n        \"defendant_legal_representative\": \"万大勇、陈卫国、KIM WOO SHIK\",\\n        \"litigation_request\": \"1. 判令被告一向原告支付货款2,562,328.12元；2. 判令被告一向原告支付截至2022年4月24日的逾期付款损失545,901.67元，并以欠付货款为基数，按日万分之五的标准支付自2022年4月25日起至货款付清之日止的后续逾期付款损失；3. 判令被告二、被告三对被告一的上述债务承担连带清偿责任；4. 判令三被告承担本案案件受理费、财产保全费、财产保全担保费。\",\\n        \"facts_and_reasons\": \"被告一因承建\\\\\"第11代超高清新型显示器件生产线项目施工总承包A标段\\\\\"项目，与原告签订《第11代超高清新型显示器件生产线项目施工总承包A标段商品砼及预拌砂浆购销合同》，合同对价格、货物结算、付款方式及争议解决方式进行了约定。合同签订后，原告严格按照合同约定向被告供应货物，但被告一却未按合同约定向原告及时支付货款，截至2022年4月24日，被告一尚欠原告货款2,562,328.12元未予支付，已构成严重违约。被告二作为被告一的唯一股东，根据《公司法》第六十三条之规定，应对公司债务承担连带责任。被告三系案涉项目的建设单位，其作为最终受益人，应对被告一的上述债务承担连带清偿责任。\",\\n        \"jurisdiction\": \"\",\\n        \"petitioner\": \"深圳市振惠建混凝土有限公司\",\\n        \"filing_date\": \"2022年4月24日\"\\n      }\\n    }\\n  }\\n}\\n```\', \'matched_placeholders\': [{\'key\': \'plaintiff_name\', \'value\': \'深圳市振惠建混凝土有限公司\', \'template_name\': \'8\', \'template_id\': \'8\'}, {\'key\': \'plaintiff_address\', \'value\': \'深圳市光明区凤凰街道塘尾社区光明大道中3号1栋一层\', \'template_name\': \'8\', \'template_id\': \'8\'}, {\'key\': \'plaintiff_credit_code\', \'value\': \'91440300743220274C\', \'template_name\': \'8\', \'template_id\': \'8\'}, {\'k