INSERT INTO `regulation_search_result` VALUES (1, NULL, NULL, NULL, '2025-10-24 08:57:42.651782', '2025-10-24 08:57:42.651802', '工伤保险条例', '职工在上下班途中，受到非本人主要责任的交通事故或者城市轨道交通、客运轮渡、火车事故伤害的，应当认定为工伤。', '第十四条第六项', '行政法规', '2011-01-01', '国务院', 0.95, 0, NULL, 32);
INSERT INTO `regulation_search_result` VALUES (2, NULL, NULL, NULL, '2025-10-24 08:57:42.658193', '2025-10-24 08:57:42.658209', '中华人民共和国社会保险法', '职工因工作原因受到事故伤害或者患职业病，且经工伤认定的，享受工伤保险待遇；其中，经劳动能力鉴定丧失劳动能力的，享受伤残待遇。', '第三十六条', '法律', '2011-07-01', '全国人民代表大会常务委员会', 0.9, 1, NULL, 32);
INSERT INTO `regulation_search_result` VALUES (3, NULL, NULL, NULL, '2025-10-24 08:57:42.664250', '2025-10-24 08:57:42.664273', '道路交通事故社会救助基金管理试行办法', '有下列情形之一时，救助基金垫付道路交通事故中受害人人身伤亡的丧葬费用、部分或者全部抢救费用：（一）抢救费用超过交强险责任限额的；（二）肇事机动车未参加交强险的；（三）机动车肇事后逃逸的。', '第十二条', '部门规章', '2010-01-01', '财政部、保监会、公安部、卫生部、农业部', 0.88, 2, NULL, 32);
INSERT INTO `regulation_search_result` VALUES (4, NULL, NULL, NULL, '2025-10-24 08:57:42.667234', '2025-10-24 08:57:42.667252', '最高人民法院关于审理工伤保险行政案件若干问题的规定', '对社会保险行政部门认定下列情形为\'上下班途中\'的，人民法院应予支持：（一）在合理时间内往返于工作地与住所地、经常居住地、单位宿舍的合理路线的上下班途中；（二）在合理时间内往返于工作地与配偶、父母、子女居住地的合理路线的上下班途中；（三）从事属于日常工作生活所需要的活动，且在合理时间和合理路线的上下班途中；（四）在合理时间内其他合理路线的上下班途中。', '第六条', '司法解释', '2014-09-01', '最高人民法院', 0.85, 3, NULL, 32);
INSERT INTO `regulation_search_result` VALUES (5, NULL, NULL, NULL, '2025-10-24 08:57:42.669764', '2025-10-24 08:57:42.669780', '中华人民共和国道路交通安全法', '医疗机构对交通事故中的受伤人员应当及时抢救，不得因抢救费用未及时支付而拖延救治。肇事车辆参加机动车第三者责任强制保险的，由保险公司在责任限额范围内支付抢救费用；抢救费用超过责任限额的，未参加机动车第三者责任强制保险或者肇事后逃逸的，由道路交通事故社会救助基金先行垫付部分或者全部抢救费用，道路交通事故社会救助基金管理机构有权向交通事故责任人追偿。', '第七十五条', '法律', '2021-04-29', '全国人民代表大会常务委员会', 0.82, 4, NULL, 32);
INSERT INTO `regulation_search_result` VALUES (6, NULL, NULL, NULL, '2025-10-24 09:02:22.683478', '2025-10-24 09:02:22.683510', '中华人民共和国民法典', '第一条 为了保护民事主体的合法权益，调整民事关系，维护社会和经济秩序，适应中国特色社会主义发展要求，弘扬社会主义核心价值观，根据宪法，制定本法。', '第一条', '民法典', '2021-01-01', '全国人民代表大会', 0.95, 0, NULL, 33);
INSERT INTO `regulation_search_result` VALUES (7, NULL, NULL, NULL, '2025-10-24 09:02:22.687128', '2025-10-24 09:02:22.687157', '中华人民共和国合同法', '第一条 为了保护合同当事人的合法权益，维护社会经济秩序，促进社会主义现代化建设，制定本法。', '第一条', '合同法', '1999-10-01', '全国人民代表大会', 0.88, 1, NULL, 33);
INSERT INTO `regulation_search_result` VALUES (8, NULL, NULL, NULL, '2025-10-24 09:02:22.690859', '2025-10-24 09:02:22.690891', '中华人民共和国刑法', '第一条 为了惩罚犯罪，保护人民，根据宪法，结合我国同犯罪作斗争的具体经验及实际情况，制定本法。', '第一条', '刑法', '1997-10-01', '全国人民代表大会', 0.82, 2, NULL, 33);
INSERT INTO `regulation_search_result` VALUES (9, NULL, NULL, NULL, '2025-10-27 01:00:55.329791', '2025-10-27 01:00:55.329806', '中华人民共和国劳动合同法', '用人单位有下列情形之一的，劳动者可以解除劳动合同：（一）未按照劳动合同约定提供劳动保护或者劳动条件的；（二）未及时足额支付劳动报酬的；（三）未依法为劳动者缴纳社会保险费的；（四）用人单位的规章制度违反法律、法规的规定，损害劳动者权益的；（五）因本法第二十六条第一款规定的情形致使劳动合同无效的；（六）法律、行政法规规定劳动者可以解除劳动合同的其他情形。用人单位以暴力、威胁或者非法限制人身自由的手段强迫劳动者劳动的，或者用人单位违章指挥、强令冒险作业危及劳动者人身安全的，劳动者可以立即解除劳动合同，不需事先告知用人单位。', '第三十八条', '法律', '2013-07-01', '全国人民代表大会常务委员会', 0.92, 0, NULL, 52);
INSERT INTO `regulation_search_result` VALUES (10, NULL, NULL, NULL, '2025-10-27 01:00:55.333281', '2025-10-27 01:00:55.333296', '中华人民共和国劳动合同法', '有下列情形之一的，用人单位应当向劳动者支付经济补偿：（一）劳动者依照本法第三十八条规定解除劳动合同的；（二）用人单位依照本法第三十六条规定向劳动者提出解除劳动合同并与劳动者协商一致解除劳动合同的；（三）用人单位依照本法第四十条规定解除劳动合同的；（四）用人单位依照本法第四十一条第一款规定解除劳动合同的；（五）除用人单位维持或者提高劳动合同约定条件续订劳动合同，劳动者不同意续订的情形外，依照本法第四十四条第一项规定终止固定期限劳动合同的；（六）依照本法第四十四条第四项、第五项规定终止劳动合同的；（七）法律、行政法规规定的其他情形。', '第四十六条', '法律', '2013-07-01', '全国人民代表大会常务委员会', 0.95, 1, NULL, 52);
INSERT INTO `regulation_search_result` VALUES (11, NULL, NULL, NULL, '2025-10-27 01:00:55.336356', '2025-10-27 01:00:55.336371', '中华人民共和国劳动合同法', '经济补偿按劳动者在本单位工作的年限，每满一年支付一个月工资的标准向劳动者支付。六个月以上不满一年的，按一年计算；不满六个月的，向劳动者支付半个月工资的经济补偿。劳动者月工资高于用人单位所在直辖市、设区的市级人民政府公布的本地区上年度职工月平均工资三倍的，向其支付经济补偿的标准按职工月平均工资三倍的数额支付，向其支付经济补偿的年限最高不超过十二年。本条所称月工资是指劳动者在劳动合同解除或者终止前十二个月的平均工资。', '第四十七条', '法律', '2013-07-01', '全国人民代表大会常务委员会', 0.88, 2, NULL, 52);
INSERT INTO `regulation_search_result` VALUES (12, NULL, NULL, NULL, '2025-10-27 01:00:55.339494', '2025-10-27 01:00:55.339509', '中华人民共和国劳动合同法', '用人单位违反本法规定解除或者终止劳动合同，劳动者要求继续履行劳动合同的，用人单位应当继续履行；劳动者不要求继续履行劳动合同或者劳动合同已经不能继续履行的，用人单位应当依照本法第八十七条规定支付赔偿金。', '第四十八条', '法律', '2013-07-01', '全国人民代表大会常务委员会', 0.85, 3, NULL, 52);
INSERT INTO `regulation_search_result` VALUES (13, NULL, NULL, NULL, '2025-10-27 01:00:55.342425', '2025-10-27 01:00:55.342439', '中华人民共和国劳动合同法', '用人单位违反本法规定解除或者终止劳动合同的，应当依照本法第四十七条规定的经济补偿标准的二倍向劳动者支付赔偿金。', '第八十七条', '法律', '2013-07-01', '全国人民代表大会常务委员会', 0.9, 4, NULL, 52);
INSERT INTO `regulation_search_result` VALUES (14, NULL, NULL, NULL, '2025-10-27 01:00:55.344790', '2025-10-27 01:00:55.344803', '中华人民共和国劳动合同法实施条例', '用人单位违反劳动合同法的规定解除或者终止劳动合同，依照劳动合同法第八十七条的规定支付了赔偿金的，不再支付经济补偿。赔偿金的计算年限自用工之日起计算。', '第二十五条', '行政法规', '2008-09-18', '国务院', 0.82, 5, NULL, 52);
INSERT INTO `regulation_search_result` VALUES (15, NULL, NULL, NULL, '2025-10-27 01:00:55.347837', '2025-10-27 01:00:55.347868', '最高人民法院关于审理劳动争议案件适用法律问题的解释（一）', '劳动者依据劳动合同法第三十八条规定解除劳动合同的，应当通知用人单位。劳动者未履行通知程序，事后以用人单位存在劳动合同法第三十八条规定情形为由请求解除劳动合同并主张经济补偿的，人民法院不予支持。', '第四十五条', '司法解释', '2021-01-01', '最高人民法院', 0.78, 6, NULL, 52);
INSERT INTO `regulation_search_result` VALUES (16, NULL, NULL, NULL, '2025-10-27 01:00:55.352111', '2025-10-27 01:00:55.352130', '中华人民共和国劳动争议调解仲裁法', '发生劳动争议，劳动者可以与用人单位协商，也可以请工会或者第三方共同与用人单位协商，达成和解协议。', '第四条', '法律', '2008-05-01', '全国人民代表大会常务委员会', 0.75, 7, NULL, 52);
INSERT INTO `regulation_search_result` VALUES (17, NULL, NULL, NULL, '2025-10-27 01:00:55.355258', '2025-10-27 01:00:55.355272', '中华人民共和国劳动争议调解仲裁法', '发生劳动争议，当事人不愿协商、协商不成或者达成和解协议后不履行的，可以向调解组织申请调解；不愿调解、调解不成或者达成调解协议后不履行的，可以向劳动争议仲裁委员会申请仲裁；对仲裁裁决不服的，除本法另有规定的外，可以向人民法院提起诉讼。', '第五条', '法律', '2008-05-01', '全国人民代表大会常务委员会', 0.8, 8, NULL, 52);
INSERT INTO `regulation_search_result` VALUES (18, NULL, NULL, NULL, '2025-10-27 01:00:55.357600', '2025-10-27 01:00:55.357614', '中华人民共和国劳动合同法', '用人单位应当在解除或者终止劳动合同时出具解除或者终止劳动合同的证明，并在十五日内为劳动者办理档案和社会保险关系转移手续。劳动者应当按照双方约定，办理工作交接。用人单位依照本法有关规定应当向劳动者支付经济补偿的，在办结工作交接时支付。用人单位对已经解除或者终止的劳动合同的文本，至少保存二年备查。', '第五十条', '法律', '2013-07-01', '全国人民代表大会常务委员会', 0.7, 9, NULL, 52);
